//Función de creación del PDF
function creaPDF(data){
	console.log("data");
	console.log(data);

	//Varible que define el interlineado
	var intLi = 6;
	//Variable que define la separación entre la hora y comando
	var sepHo = 43; //+17 al margen izquierdo
	//Variable que define el margen izquierdo
	var margIzqui = 43;
	//Anchura del parrafo
	var anPar = 116;
	//Altura texto
	var alPar = 265;

	var doc = new jsPDF();

	doc.rect(20, 20, 25, 25, 'F'); // empty red square
	doc.rect(40, 20, 130, 51, 'F'); // empty red square

	//Dividimos el texto para el espacio marcado y cambiamos de línea si es necesario
	//Definimos posición izquierda/altura y texto
	doc.setTextColor(255);
	doc.setFontSize(80);
	doc.text(21,42,"9");
	doc.setFontSize(50);
	doc.text(43,42,"PUNTO DE ");
	doc.setFontSize(50);
	doc.text(43, 62, "SATURACIÓN");
	doc.setFontSize(8);
	doc.setTextColor(40);

	//Loop con cáculo automático de final de línea y salto a la siguiete
	for(var i = 0, textlength = data.length ; i < textlength ; i++) {
		if (data[i].tipo == "normal") {
			doc.setFontSize(8);
			var splitNormal = doc.splitTextToSize(data[i].contenido, anPar);
			//loop thru each line and output while increasing the vertical space
	    for(var c = 0, stlength = splitNormal.length ; c < stlength ; c++){
				doc.setTextColor(40);
	      doc.text(margIzqui, comPar, splitNormal[c]);
	      comPar = comPar + intLi;
				//Si hemos llegado al final de la página cremamos una nueva
				if (comPar >= alPar) {
					doc.addImage(imagen,'JPEG', 168, 17, 28, 254);
					doc.addPage();
					//Añadimos cabecera
					doc.rect(20, 20, 25, 25, 'F'); // empty red square
					doc.rect(40, 20, 130, 51, 'F'); // empty red square
					doc.setTextColor(255);
					doc.setFontSize(80);
					doc.text(21,42,"9");
					doc.setFontSize(50);
					doc.text(43,42,"PUNTO DE ");
					doc.setFontSize(50);
					doc.text(43, 62, "SATURACIÓN");
					comPar = 77;
				}
	    }
		}
		else {
			doc.setFontSize(12);
			var splitAccion = doc.splitTextToSize(data[i].contenido, anPar);

			//loop thru each line and output while increasing the vertical space
	    for(var c = 0, stlength = splitAccion.length ; c < stlength ; c++){
				doc.setTextColor(130);
				doc.text(sepHo, comPar, splitAccion[c]);
	      comPar = comPar + intLi;
				//Si hemos llegado al final de la página cremamos una nueva
				if (comPar >= alPar) {
					doc.addImage(imagen,'JPEG', 168, 17, 28, 254);
					//Creamos nueva página
					doc.addPage();
					//Añadimos cabecera
					doc.rect(20, 20, 25, 25, 'F'); // empty red square
					doc.rect(40, 20, 130, 51, 'F'); // empty red square
					doc.setTextColor(255);
					doc.setFontSize(80);
					doc.text(21,42,"9");
					doc.setFontSize(50);
					doc.text(43,42,"PUNTO DE ");
					doc.setFontSize(50);
					doc.text(43, 62, "SATURACIÓN");
					comPar = 77;
				}
	    }
		}
	}

	//doc.addImage(imagen,'JPEG', 0, 260, 220, 28);
	doc.addImage(imagen,'JPEG', 168, 17, 28, 254);

	//Guardamos el pDF
	doc.save('salida.pdf');

}

//Función para publicar directamente en el algoritmo según las respuestas del formulario
